import React, { useState } from 'react';
import axios from 'axios';

const CompatibilityTab = () => {
  const [person1, setPerson1] = useState({ name: '', dob: '', pob: '', tob: '' });
  const [person2, setPerson2] = useState({ name: '', dob: '', pob: '', tob: '' });
  const [compatibilityType, setCompatibilityType] = useState('amoureuse');
  const [response, setResponse] = useState('');

  const handlePersonChange = (e, person) => {
    const { name, value } = e.target;
    person === 'person1' ? setPerson1({ ...person1, [name]: value }) : setPerson2({ ...person2, [name]: value });
  };

  const handleCompatibilityTypeChange = (e) => {
    setCompatibilityType(e.target.value);
  };

  const createPrompt = (person1, person2, compatibilityType) => {
    return `Quelle est la compatibilité ${compatibilityType} entre ${person1.name} (né(e) le ${person1.dob} à ${person1.pob} à ${person1.tob}) et ${person2.name} (né(e) le ${person2.dob} à ${person2.pob} à ${person2.tob}) ?`;
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    const prompt = createPrompt(person1, person2, compatibilityType);

    // Interagir avec l'API OpenAI
    const API_KEY = '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';
    const result = await axios.post(
      'https://api.openai.com/v1/engines/davinci-codex/completions',
      {
        prompt,
        max_tokens: 512,
        n: 1,
        stop: null,
        temperature: 1,
      },
      {
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${API_KEY}`,
        },
      }
    );

    setResponse(result.data.choices[0].text);
  };

  return (
    <div className="compatibility-tab">
      {/* Inputs for Person 1 */}
      <h3>Personne 1</h3>
      <label>
        Prénom :
        <input type="text" name="name" value={person1.name} onChange={(e) => handlePersonChange(e, 'person1')} />
      </label>
      <label>
        Date de naissance :
        <input type="date" name="dob" value={person1.dob} onChange={(e) => handlePersonChange(e, 'person1')} />
      </label>
      <label>
        Lieu de naissance :
        <input type="text" name="pob" value={person1.pob} onChange={(e) => handlePersonChange(e, 'person1')} />
      </label>
      <label>
        Heure de naissance :
        <input type="time" name="tob" value={person1.tob} onChange={(e) => handlePersonChange(e, 'person1')} />
      </label>

      {/* Inputs for Person 2 */}
      <h3>Personne 2</h3>
      <label>
        Prénom :
        <input type="text" name="name" value={person2.name} onChange={(e) => handlePersonChange(e, 'person2')} />
      </label>
      <label>
      Date de naissance :
      <input type="date" name="dob" value={person2.dob} onChange={(e) => handlePersonChange(e, 'person2')} />
    </label>
    <label>
      Lieu de naissance :
      <input type="text" name="pob" value={person2.pob} onChange={(e) => handlePersonChange(e, 'person2')} />
    </label>
    <label>
      Heure de naissance :
      <input type="time" name="tob" value={person2.tob} onChange={(e) => handlePersonChange(e, 'person2')} />
    </label>

    {/* Radio buttons for compatibility type */}
    <label>
      <input
        type="radio"
        value="amoureuse"
        checked={compatibilityType === "amoureuse"}
        onChange={handleCompatibilityTypeChange}
      />
      Amoureuse
    </label>
    <label>
      <input
        type="radio"
        value="professionnelle"
        checked={compatibilityType === "professionnelle"}
        onChange={handleCompatibilityTypeChange}
      />
      Professionnelle
    </label>
    <label>
      <input
        type="radio"
        value="amicale"
        checked={compatibilityType === "amicale"}
        onChange={handleCompatibilityTypeChange}
      />
      Amicale
    </label>

    {/* Submit button */}
    <button onClick={handleSubmit}>Calculer la compatibilité</button>

    {/* Display the response */}
    <div className="compatibility-response">
      <h3>Résultat de la compatibilité :</h3>
      <p>{response}</p>
    </div>
  </div>
  );
};

export default CompatibilityTab;
